              "og:site_name": "DigitalGov",
              "fb:admins": "100000569454928",
              "og:description": "In 25 years, imagine a world where anytime, anywhere, any device is just taken for granted. That’s the theme from the responses we got from our Mobile Gov Community of Practice members when we asked them to predict the effect mobile would have on the Web over the next 25 years. While no one claimed to have the exact answer, most members described a future state where the Web was pervasive, not just tied to your computer or smartphone, but interacting with anything and everything. “It will be the Internet of Things, plus much more,” said Lawrence Charters, Internet Projects Manager, National Ocean Service, part of the National Oceanic and Atmospheric Administration. Many community members spoke of scannable, wearable, drivable and flyable devices in private sector development or ones that they currently owned (mostly fitness app related). But Dina Li, an IT Specialist from the USDA Economic Research Service, offered a good illustration of what Charters' “plus much more” might entail:",
